import React from 'react';
import { Routes, Route, Outlet, Link } from "react-router-dom";

export default function App() {
    return (
        <div>
            <h1>SoundTracked</h1>

            <Routes>
                <Route path="/" element={<Layout />}>
                    <Route index element={<Home />}/>
                    <Route path="connect" element={<Connect />}/>
                    <Route path="*" element={<NoMatch />}/>
                </Route>
            </Routes>
        </div>
    );
}

// MAIN LAYOUT CONTENT
function Layout() {
    return (
        <div>

        </div>
    );
}

// LANDING PAGE CONTENT 
function Home() {
    return (
        <div>
            <h1>Does the music you listen to make you run <span>faster?</span></h1>
            <p>SoundTracked looks to solve the common problem whether the music you listen to is helping your running performance and provide music to maintain or improve your pace.</p>
            <button>Try It Now</button>
        </div>
    );
}

function Connect() {
    return (
        <div>
            connect
        </div>
    )
}

function NoMatch() {
    return (
        <div>
            <h1>Not Found</h1>
            <p>
                <Link to="/">Go to the home page</Link>
            </p>
        </div>
    );
}
